  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0155859 includes physical
  and underway data collected aboard the ROGER REVELLE during cruise KNOX13RR in the
  Indian Ocean from 2008-01-07 to 2008-01-30. These data include CURRENT SPEED - EAST/WEST
  COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The instruments used
  to collect these data include ADCP and GPS. These data were collected by Jennifer
  MacKinnon of University of California - San Diego; Scripps Institution of Oceanography
  as part of Internal Waves and Mixing above the South West Indian Ridge. The Lamont-Doherty
  Earth Observatory (LDEO) submitted these data to NCEI as part of the NSF sponsored
  Rolling Deck to Repository (R2R) program.nnThe ADCP data represent the raw and automated
  processed data set. Post processed quality assessed data are not available in this
  accession.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
